import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import ListEmployee from "./components/ListEmployee";
import Footer from "./components/Footer";
import Header from "./components/Header";

function App() {
  return (
    <div>
      <Router>
        <div>
          <Header />

          <div className="App">
            <ListEmployee />
          </div>

          <Footer />
        </div>
      </Router>
    </div>
  );
}

export default App;
